text:
 @CAP_-_  
Cuiabá com um a menos, folha salário 10x menor que a do Athletico paranaense, jogando fora de casa e conseguiu o empate, merecendo ganhar.

Esse timéco seu aí vai ser amassado pelo flamengo. Não espero menos que 3x0 na final da libertadores.

 @CAP_-_  
Então vai ter que aguentar ouvir, que seu timéco é fraco, tomou um sacode do Cuiabá em casa e vai ser massacrado pelo Flamengo.
Com o tempo o Athletico Paranaense vai voltar a ser timéco de série B que sempre foi ;)
